sys_variable_value.value:
(function execute(inputs, outputs) {

  var loc_id = inputs.location_record;

  //Check name length for which attribute to write back to the location table
  var name_length = "long_name";
  if(inputs.name_length == "Short"){
    name_length = "short_name";
  }

  //Parser for Place Details (result)
  var json = new global.JSONParser();
  var res = json.parse(inputs.json);

  //Script include to traverse payload and update/create records
  new x_481580_google_0.googlePlaceUtils().feedJSON(res,loc_id);

})(inputs, outputs);

